import React from 'react';
import ReactDOM from 'react-dom/client';
import TableDemo from './tabledemo.jsx';
import { data } from './data.js';
import './table.css'

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    {data}
    <TableDemo/>
  </React.StrictMode>
);
